import React from 'react';
import { useNavigate } from 'react-router-dom';
const logo = "https://res.cloudinary.com/dzihypwia/image/upload/v1737871766/W3B_LOGO_r3v890.png";

export function Footer() {
    const navigate = useNavigate();

    const scrollToSection = (sectionId) => {
        const element = document.getElementById(sectionId);
        if (element) {
            element.scrollIntoView({ behavior: 'smooth' });
        }
    };

    const handleSubscribe = (e) => {
        e.preventDefault();
        // Add your subscribe logic here
        console.log('Subscribed!');
    };

    return (
        <footer className="bg-black pt-6 sm:pt-8 md:pt-11">
            <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
                <div className="flex flex-col lg:flex-row justify-between pb-8 lg:pb-16 space-y-8 lg:space-y-0">
                    {/* Logo and Subscribe Section */}
                    <div className="mt-4 sm:mt-8 lg:mt-20 text-white">
                        <div className="flex items-center mb-6">
                            <img 
                                src={logo} 
                                alt="W3B Logo" 
                                className="h-8 w-8 sm:h-10 sm:w-10 lg:h-12 lg:w-12"
                            />
                            <h1 className="text-xl sm:text-2xl lg:text-4xl text-purple-500 font-bold ml-2">W3B</h1>
                        </div>
                        <div className="flex flex-col sm:flex-row w-full lg:w-[24rem] border-2 border-gray-900 rounded-lg overflow-hidden">
                            <input 
                                type="text" 
                                placeholder="Enter your Email..." 
                                className="flex-1 bg-black h-12 px-4 focus:outline-none text-sm w-full"
                            />
                            <button 
                                onClick={handleSubscribe}
                                className="w-full sm:w-auto px-4 sm:px-6 py-3 bg-purple-700 text-white hover:bg-purple-600 transition-all duration-300 mt-2 sm:mt-0"
                            >
                                Subscribe
                            </button>
                        </div>
                    </div>

                    {/* Navigation and Social Links */}
                    <div className="flex flex-col sm:flex-row gap-8 lg:gap-16 text-white">
                        {/* Pages Navigation */}
                        <div className="w-full sm:w-auto">
                            <h2 className="text-lg font-medium mb-4">Pages</h2>
                            <nav className="flex flex-col space-y-3">
                                <button 
                                    onClick={() => {
                                        navigate('/');
                                        window.scrollTo(0, 0);
                                    }}
                                    className="text-gray-400 hover:text-gray-300 hover:underline text-left"
                                >
                                    Home
                                </button>
                                <button 
                                    onClick={() => scrollToSection('about')}
                                    className="text-gray-400 hover:text-gray-300 hover:underline text-left"
                                >
                                    About
                                </button>
                                <button 
                                    onClick={() => scrollToSection('events')}
                                    className="text-gray-400 hover:text-gray-300 hover:underline text-left"
                                >
                                    Events
                                </button>
                                <button 
                                    onClick={() => scrollToSection('team')}
                                    className="text-gray-400 hover:text-gray-300 hover:underline text-left"
                                >
                                    Team
                                </button>
                                <button 
                                    onClick={() => scrollToSection('comments')}
                                    className="text-gray-400 hover:text-gray-300 hover:underline text-left"
                                >
                                    Contact
                                </button>
                            </nav>
                        </div>

                        {/* Social Links */}
                        <div className="w-full sm:w-auto">
                            <h2 className="text-lg font-medium mb-4">Social</h2>
                            <nav className="flex flex-col space-y-3">
                                <a 
                                    href="https://www.instagram.com/w3b__jmi/" 
                                    target="_blank" 
                                    rel="noopener noreferrer"
                                    className="text-gray-400 hover:text-gray-300 hover:underline"
                                >
                                    Instagram
                                </a>
                                <a 
                                    href="https://linkedin.com/company/the-w3b-ai-and-blockchain-society-jmi" 
                                    target="_blank" 
                                    rel="noopener noreferrer"
                                    className="text-gray-400 hover:text-gray-300 hover:underline"
                                >
                                    LinkedIn
                                </a>
                            </nav>
                        </div>
                    </div>
                </div>

                {/* Footer Bottom */}
                <div className="flex flex-col sm:flex-row justify-between items-center border-t-2 border-zinc-800 py-4 sm:py-5 space-y-4 sm:space-y-0">
                    <div className="text-gray-400 text-sm font-semibold">
                        &copy; 2024 W3B
                    </div>
                    <div className="flex flex-col sm:flex-row items-center space-y-2 sm:space-y-0 sm:space-x-8 text-gray-400 font-semibold">
                        <button 
                            onClick={() => navigate('/')}
                            className="hover:text-gray-300"
                        >
                            Terms of Service
                        </button>
                        <button 
                            onClick={() => navigate('/')}
                            className="hover:text-gray-300"
                        >
                            Privacy Policy
                        </button>
                    </div>
                </div>
            </div>
        </footer>
    );
}

export default Footer;
